          <a href="http://www.newtonslab.in/#pricing">
            Save 90% on subscription for a limited time only â†’
          </a>
        </p>
      </div>
      <div>
        <nav className="navbar black">
          <div className="navbar-container">
            <div className="newton-part">newton
            </div>
            <div className="midllepart">
              <li>home</li>
              <li>usecase </li>
              <li>pricing</li>
